import React, { useRef, useEffect, useState } from 'react';
import * as THREE from 'three';
import { OrbitControls } from 'three/examples/jsm/controls/OrbitControls.js';

function Planner() {
    const mountRef = useRef(null);
    const [isOpen, setIsOpen] = useState(false);
    const [goals, setGoals] = useState([]);
    const togglePopup = () => setIsOpen(!isOpen);

    useEffect(() => {
        const scene = new THREE.Scene();
        const camera = new THREE.PerspectiveCamera(75, window.innerWidth / window.innerHeight, 0.1, 1000);
        const renderer = new THREE.WebGLRenderer();
        renderer.setSize(window.innerWidth, window.innerHeight);
        mountRef.current.appendChild(renderer.domElement);

        const geometry = new THREE.BoxGeometry();
        const material = new THREE.MeshBasicMaterial({ color: 0x00ff00 });
        const cube = new THREE.Mesh(geometry, material);
        scene.add(cube);

        camera.position.z = 5;

        const controls = new OrbitControls(camera, renderer.domElement);
        const animate = () => {
            requestAnimationFrame(animate);
            cube.rotation.x += 0.01;
            cube.rotation.y += 0.01;
            controls.update();
            renderer.render(scene, camera);
        };
        animate();

        return () => mountRef.current.removeChild(renderer.domElement);
    }, []);

    const handleSubmit = (e) => {
        e.preventDefault();
        const formData = new FormData(e.target);
        const newGoal = {
            priority: formData.get('priority'),
            goal: formData.get('goal'),
            action: formData.get('action'),
            startTime: formData.get('startTime'),
            endTime: formData.get('endTime'),
            breakDuration: formData.get('breakDuration'),
            status: formData.get('status')
        };
        setGoals([...goals, newGoal]);
        togglePopup();
    };

    return (
        <div className="planner">
            <div ref={mountRef}></div>
            <section>
                <h2>Welcome to Planner</h2>
                <h3>Where you can write your path down for Success</h3>
            </section>
            <section>
                <h2>Planner Table</h2>
                <div className="goalenterer">
                    <button onClick={togglePopup}>Enter Goal</button>
                    {isOpen && (
                        <div className="popup-overlay">
                            <div className="popup-content">
                                <form id="myform" onSubmit={handleSubmit}>
                                    <label htmlFor="goal">What is your goal?</label>
                                    <input type="text" id="goal" name="goal" required /><br />
                                    <label htmlFor="priority">What Priority is your Goal?</label>
                                    <input type="number" id="priority" name="priority" required /><br />
                                    <label htmlFor="action">What is your action plan?</label>
                                    <input type="text" id="action" name="action" required /><br />
                                    <label htmlFor="startTime">Start Time:</label>
                                    <input type="datetime-local" id="startTime" name="startTime" required /><br />
                                    <label htmlFor="endTime">End Time:</label>
                                    <input type="datetime-local" id="endTime" name="endTime" required /><br />
                                    <label htmlFor="breakDuration">Break Duration (minutes):</label>
                                    <input type="number" id="breakDuration" name="breakDuration" /><br />
                                    <label htmlFor="status">Status:</label>
                                    <select id="status" name="status">
                                        <option value="Not Started">Not Started</option>
                                        <option value="In Progress">In Progress</option>
                                        <option value="Completed">Completed</option>
                                        <option value="On Hold">On Hold</option>
                                    </select><br />
                                    <input type="submit" id="gsubmit" value="Add Goal" />
                                </form>
                                <button onClick={togglePopup}>Close</button>
                            </div>
                        </div>
                    )}
                </div>
                <table className="use" cellPadding="5">
                    <thead>
                        <tr>
                            <th scope="col">Priority</th>
                            <th scope="col">Goals</th>
                            <th scope="col">Action</th>
                            <th scope="col">Start Time</th>
                            <th scope="col">End Time</th>
                            <th scope="col">Break Duration</th>
                            <th scope="col">Status</th>
                        </tr>
                    </thead>
                    <tbody>
                        {goals.map((goal, index) => (
                            <tr key={index}>
                                <td>{goal.priority}</td>
                                <td>{goal.goal}</td>
                                <td>{goal.action}</td>
                                <td>{goal.startTime}</td>
                                <td>{goal.endTime}</td>
                                <td>{goal.breakDuration} mins</td>
                                <td>
                                    <select defaultValue={goal.status}>
                                        <option value="Not Started">Not Started</option>
                                        <option value="In Progress">In Progress</option>
                                        <option value="Completed">Completed</option>
                                        <option value="On Hold">On Hold</option>
                                    </select>
                                </td>
                            </tr>
                        ))}
                    </tbody>
                </table>
            </section>
        </div>
    );
}

export default Planner;
